import React, {Component} from "react";
import axios from "axios";
import DangerFeedback from "./Feedback/DangerFeedback";
import LoadingSpinnerPrimaryLongBtn from "./Spinners/LoadingSpinnerPrimaryLongBtn";

class CheckOut extends Component {
    constructor(props) {
        super(props);

    }


    render() {
        return (
            <div className="backgroundContainer mt-5">
                <div className="row text-center justify-content-center mt-3">
                    <div className="col-md-8 col-lg-6 bg-light mt-5 shadow rounded">
                        <div className="container">
                            <div className="row text-center">
                                <div className="col-12 mt-2">
                                    <h4>Check Out</h4>
                                </div>
                            </div>
                            <form onSubmit={this.handleSubmit} className="row text-left">
                                <div className="col-6">
                                    <h1>Hello world!</h1>
                                </div>
                                <div className="col-6">
                                    <h1>Hello world!</h1>
                                </div>

                            </form>
                        </div>

                    </div>
                </div>

            </div>
        );
    }
}

export default CheckOut;
